import '../Components/Root/Root.css'
import '../Components/Root/Reset.css'




import Pdv from "./Pdv"
import { BrowserRouter, Routes, Route } from 'react-router-dom'



function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>

          <Route  path="/" element={<Pdv/>} ></Route>

        </Routes>
      </BrowserRouter>

    <Header />
      <Apresentacao />
      <Footer />
    </>
  );
}

export default App;
